<style>.maze {
    background-color: white;
    margin-bottom: 20px
}

.maze .maze-row {
    display: table-row
}

.maze .maze-field {
    width: 20px;
    height: 20px;
    float: left;
    border: 1px solid transparent
}

.maze .maze-field.top {
    border-top: 1px solid black
}

.maze .maze-field.right {
    border-right: 1px solid black
}

.maze .maze-field.bottom {
    border-bottom: 1px solid black
}

.maze .maze-field.left {
    border-left: 1px solid black
}

.maze .maze-field.start {
    background-color: silver
}

.maze .maze-field.exit {
    background-color: silver
}

.maze .maze-field.marked {
    background-color: #98FB98
}

.maze-field:hover::before {
    content: attr(data-title)
}</style>
